import React from 'react';

export default function Profile() {
  return (
    <div className="profile_box">
      <div className="flex_box-lg">
        <div className="profile_image" />
        <div>
          <div className="profile_email">test@naver.com</div>
        </div>
      </div>
    </div>
  );
}
